import React, { Component } from 'react';
import '../SearchBox.css'


export default class SearchPage extends Component {

    state ={
        text : ''
    }

    render() {
        return (
            <div>
                <form className="search-box">
                    <input className ="search-txt"
                     type ="text"
                     placeholder="search"
                     name ="text"
                     value ={this.state.text} />
                     <input type = "submit"
                      value="search"
                      className ="search-btn" />               
                </form>
            </div>

        )
    }
}
